MACOSX_DEPLOYMENT_TARGET:
- '11.0'
MACOSX_SDK_VERSION:
- '11.0'
channel_sources:
- conda-forge
channel_targets:
- conda-forge main
cross_target_platform:
- win-64
macos_machine:
- arm64-apple-darwin20.0.0
rust_arch:
- x86_64-pc-windows-msvc
rust_arch_env:
- X86_64_PC_WINDOWS_MSVC
rust_arch_env_build:
- AARCH64_APPLE_DARWIN
rust_default_cc:
- clang-cl
rust_default_cc_build:
- arm64-apple-darwin20.0.0-clang
target_c_stdlib_version:
- '11.0'
target_platform:
- osx-arm64
version:
- 1.79.0
zip_keys:
- - cross_target_platform
  - rust_arch
  - rust_arch_env
  - rust_default_cc
  - MACOSX_SDK_VERSION
  - MACOSX_DEPLOYMENT_TARGET
  - target_c_stdlib_version
  - channel_sources
  - channel_targets
  - version
